import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { Pixelify } from "react-pixelify";

const src = require("./image.png");

<Pixelify
  src={src}
  width={250}
  height={250}
  centered={true}
  pixelSize={5}
  fillTransparencyColor={white}
/>
